// client/src/App.js
import './App.css';
import React, { useState } from 'react';
import UploadedFile from './components/UploadedFile';
import QueryResults from './components/QueryResults';
import FileUpload from './components/FileUpload';

function App() {
  const [ocrResults, setOCRResults] = useState([]);
  const [uploadedFile, setUploadedFile] = useState(null);

  const handleUpload = ({ file, ocrText }) => {
    setUploadedFile({ file, ocrText }); // Update uploadedFile state with both file and OCR text
    // Handle further processing if needed
  };

  return (
    <div className="App">
      <h1>OCR App</h1>
      <FileUpload onUpload={handleUpload} />
      <UploadedFile file={uploadedFile?.file} />
      {ocrResults.length > 0 && <QueryResults results={ocrResults} />}
    </div>
  );
}

export default App;
